import { useState } from 'react'
import Note from './Note'


const App = () => {
  const [ notes, setNotes ] = useState([])
  const [ newNote, setNewNote ] = useState('enter a note here...')

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {notes.map(note => {
          <Note key={note.id} content={note.content} />
        })}
      </ul>
    </div>
  )
}

export default App;
